// src/routes.js
import React from 'react';
import { Routes, Route } from 'react-router-dom';

// Existing imports
import Dashboard from './pages/Dashboard';
import Segmentation from './pages/Segmentation';
import UserJourney from './pages/UserJourney';
import PersonalizationPage from './pages/PersonalizationPage';

// New page imports
import ChurnPredictionPage from './pages/ChurnPredictionPage';
import ReferralInsightsPage from './pages/ReferralInsightsPage';
import FeatureUsagePage from './pages/FeatureUsagePage';

const App = () => {
  return (
    <Routes>
      <Route path="/dashboard" element={<Dashboard />} />
      <Route path="/segmentation" element={<Segmentation />} />
      <Route path="/user-journey" element={<UserJourney />} />
      <Route path="/personalization" element={<PersonalizationPage />} />
      <Route path="/churn-prediction" element={<ChurnPredictionPage />} />
      <Route path="/referral-insights" element={<ReferralInsightsPage />} />
      <Route path="/feature-usage" element={<FeatureUsagePage />} />
    </Routes>
  );
};

export default App;
